pragma solidity >=0.4.22 <0.9.0;

contract Todolist{
    uint public taskCount = 0;
    
    struct Task {
        uint id;
        string content;
        bool compeleted;
    }
    mapping (uint => Task) public tasks;

    event TaskCreated (
        uint id,
        string content,
        bool compeleted
    );
    
    event TaskCompeleted (
        uint id,
        bool compeleted
    );
    
    constructor() public{
        createTask("play Football");
        createTask('Do homework');
    }
    

    
    function createTask(string memory _content) public {
        taskCount++;
        tasks[taskCount] = Task(taskCount,_content,false);
        
    }
    
    function CompeleteTask(uint _id) public{
        Task memory _task = tasks[_id];
        _task.compeleted = !_task.compeleted;
        tasks[_id] = _task;
        
        
    }
    
    
    
}
